import { Main,Breadcrumbs } from "govuk-react";

function DoctorViewandUpdate(){
    return(

        <div>
        <Main>
            <Breadcrumbs>
        <Breadcrumbs.Link to="/">
    HomePage
  </Breadcrumbs.Link>
  <Breadcrumbs.Link to="/DoctorDashBoard">
  Doctor DashBoard</Breadcrumbs.Link>
  <Breadcrumbs.Link to="/DoctorDashBoard">
  Doctor Appointment</Breadcrumbs.Link>
  </Breadcrumbs>
  <br/>  <br/>

            </Main>    
        </div>
    );
}
export default DoctorViewandUpdate;
